import Link from "next/link"

export default function test7(props){
    return (
        <html>
            <body>
                <div>On Olusturma</div>
                <Link href="/posts/index.js">page1-posts</Link>
                {props.map((prop)=>(
                    <div>Next{prop.go}</div>
                ))}
            </body>
        </html>
    )

}
export async function getServerSideProps(context){
    const res=await fetch("https://api.github.com/repos/vercel")
    const json=await res.json()
    return{
        props:{go:json.stargazers_count}
    }
}
